import React from "react";
import Modal from "react-bootstrap/Modal";

export default function AlertsModal(ac) {
  return (
    <div>
      <Modal
        size="sm"
        show={ac.dc.showModal}
        // onHide={() => ac.dc.setshowModal(false)}
        aria-labelledby="network-top-user-modal"
      >
        <Modal.Body>Select Organization and Network</Modal.Body>
      </Modal>
    </div>
  );
}
